#include <iostream>
#include <string>
#include <algorithm>
using namespace std;
int main(){
    int n,ans=0;
    cin>>n;
    bool a[100000];
    for(int i=2;i<n;++i){
        a[i]=1;
    }
    for(int i=2;i<n;++i){
        if(a[i]){
            for(int j=0;i*(j+2)<n;++j){
                a[i*(j+2)]=0;
            }
        }
    }
    for(int i=0;i<n;++i){
        if(a[i]==1){
            ++ans;
        }
    }
    cout<<ans<<endl;
}
